import React, { useEffect } from "react";

const { kakao } = window;

function KakaoMap(props) {
  useEffect(() => {
    const container = document.getElementById("map");

    if (props.responseData && Array.isArray(props.responseData)) {
      const firstItem = props.responseData[0];
      const firstLatitude = firstItem.latitude;
      const firstLongitude = firstItem.longitude;

      const options = {
        center: new kakao.maps.LatLng(firstLatitude, firstLongitude),
        level: 4,
      };
      console.log(firstLatitude, firstLongitude)
      const map = new kakao.maps.Map(container, options);

      props.responseData.forEach((item) => {
        const latitude = item.latitude;
        const longitude = item.longitude;

        const marker = new kakao.maps.Marker({
          position: new kakao.maps.LatLng(latitude, longitude),
        });
        marker.setMap(map);
      });
    }
  }, [props.responseData]);

  return <div id="map"></div>;
}

export default KakaoMap;
